import React from 'react';
//Components
import Header from './components/Header'
import Footer from './components/Footer'

//Style
import {Container} from 'react-bootstrap'
import './App.css';


function App() {
  return (
  <>
    <Header/>
    <main>
    Container>
      <h1>Welcome</h1>
      </main>
    <Footer/>
  </>  
  );
}

export default App;
